import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

import Home from './pages/home'

function App() {
  return (
      <Router>
        <Switch>
          <Route exact path={"/"}>
            <Home/>
          </Route>
          <Route path={"/bucket"}>
            bucket
          </Route>
        </Switch>
      </Router>
  );
}

export default App;
